jQuery(document).ready(function(){jQuery("a").each(function(){var e=jQuery(this);var t=e.attr("href");if(t==undefined)return;var n=t.replace("http://","").replace("https://","");var r=t.split(".").reverse();var i=r[0].toLowerCase();var r=t.split("/").reverse();var s=r[2];var o=false;if(n.indexOf("custom-image")>=0){var u=n.split("/").reverse();var a=u[0];e.click(function(){_gaq.push(["_trackEvent",a,"custom-image",n])})}if(jQuery.inArray(i,analyticsFileTypes)!=-1){o=true;e.click(function(){if(analyticsEventTracking=="enabled"){_gaq.push(["_trackEvent","Downloads",i.toUpperCase(),t])}else _gaq.push(["_trackPageview",analyticsDownloadsPrefix+n])})}if(t.match(/^http/)&&!t.match(document.domain)&&o==false){e.click(function(){if(analyticsEventTracking=="enabled"){_gaq.push(["_trackEvent","Outbound Traffic",t.match(/:\/\/(.[^/]+)/)[1],t])}else _gaq.push(["_trackPageview",analyticsOutboundPrefix+n])})}})})